import React from 'react';
import './WhoAmI.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin } from '@fortawesome/free-brands-svg-icons';


const WhoAmI = () => {
    return (
        <div className='whoami-page'>
            <h1>Who Am I?</h1>
            <p>I'm a developer passionate about building software solutions, with a strong interest in backend technologies, databases, and web development.</p>

            <div className="social-links">
                <a href="https://github.com/Niroth36" target="_blank" rel="noopener noreferrer">
                    <FontAwesomeIcon icon={faGithub} className="social-icon" />
                </a>
                <a href="https://www.linkedin.com/in/dimitris-charitos" target="_blank" rel="noopener noreferrer">
                    <FontAwesomeIcon icon={faLinkedin} className="social-icon" />
                </a>
            </div>
        </div>
    );
};

export default WhoAmI;
